import './App.css';


function App() {
  return (
    <div className="App">
      <p>
        <input type="text"/>
      </p>
      <table>
        <tr>
          <th>Guess</th>
        </tr>
        <tr>
          <td>1</td>
          <td></td>
        </tr>
      </table>
    </div>
  );
}

export default App;
